import React from 'react';
import { Route, Switch } from 'react-router-dom'

import './App.scss';

import Homepage from './pages/homepage/homepage.component'

const HatsPage = () => (
    <div>
      <h1>HATS PAGE</h1>
    </div>
)

const App = () => {
  return (
    <div>
        <Switch>
          <Route exact path='/' component={Homepage} />
          <Route exact path = '/hats' component = {HatsPage} />
        </Switch>
    </div>
  );
}

export default App;
